oxy_webhelp_navlinks = {"acc_shortcuts_stand_c-d4802e267":{"topics":[{"title":"General keyboard shortcuts","shortdesc":"<p class=\"shortdesc\">You can use different keyboard shortcuts to navigate through HCL Notes®. Note that Ctrl+Shift+L is a keyboard shortcut that displays a list of other available, useful shortcuts.<\/p>","href":"acc_sho_general_r.html","attributes":{"data-id":"acc_sho_general_r"},"menu":{"hasChildren":false},"tocID":"acc_sho_general_r-d4802e283","topics":[]},{"title":"Keyboard shortcuts for applications","shortdesc":"<p class=\"shortdesc\">Keyboard shortcuts help users who have a physical disability, such as restricted mobility or limited vision, to use applications successfully.<\/p>","href":"acc_sho_app_r.html","attributes":{"data-id":"acc_sho_app_r"},"menu":{"hasChildren":false},"tocID":"acc_sho_app_r-d4802e299","topics":[]},{"title":"Keyboard shortcuts for properties boxes","shortdesc":"<p class=\"shortdesc\">You can use a number of keyboard shortcuts when using properties boxes.<\/p>","href":"acc_sho_props_r.html","attributes":{"data-id":"acc_sho_props_r"},"menu":{"hasChildren":false},"tocID":"acc_sho_props_r-d4802e312","topics":[]},{"title":"Keyboard shortcuts to select and move text in a document ","shortdesc":"<p class=\"shortdesc\">You can use keyboard shortcuts when you are creating or editing a mail message or a document.<\/p>","href":"acc_sho_edit_r.html","attributes":{"data-id":"acc_sho_edit_r"},"menu":{"hasChildren":false},"tocID":"acc_sho_edit_r-d4802e325","topics":[]},{"title":"Keyboard shortcuts to move the cursor in a document","shortdesc":"<p class=\"shortdesc\">You can use different keyboard shortcuts to move the cursor when you are creating or editing a mail message or a document.<\/p>","href":"acc_sho_move_r.html","attributes":{"data-id":"N10001"},"menu":{"hasChildren":false},"tocID":"N10001-d4802e338","topics":[]},{"title":"Keyboard shortcuts to change text and paragraph properties in a document","shortdesc":"<p class=\"shortdesc\">You can use different keyboard shortcuts when you are creating or editing a mail message or a document. <\/p>","href":"acc_sho_text_r.html","attributes":{"data-id":"N10001"},"menu":{"hasChildren":false},"tocID":"N10001-d4802e351","topics":[]},{"title":"Keyboard shortcuts for the Macintosh","shortdesc":"<p class=\"shortdesc\">You can use keyboard shortcuts to navigate through and perform tasks in HCL Notes®.<\/p>","href":"acc_shortcuts_mac_c.html","attributes":{"data-id":"acc_shortcuts_mac_c"},"menu":{"hasChildren":true},"tocID":"acc_shortcuts_mac_c-d4802e364","next":"acc_shortcuts_mac_c-d4802e364"},{"title":"Using Unicode to add special characters to documents","shortdesc":"<p class=\"shortdesc\">You can create or read documents that contain special characters that aren't found on your default keyboard, such as an ae dipthong (Æ), a pound sign (£), or a plus\/minus sign (+\/-).<\/p>","href":"acc_unicode_t.html","attributes":{"data-id":"acc_unicode_t"},"menu":{"hasChildren":false},"tocID":"acc_unicode_t-d4802e432","topics":[]},{"title":"Special characters listed by extended compose sequence","shortdesc":"<p class=\"shortdesc\">A compose sequence is a string of keystrokes that produces a special character. You can use a compose sequence or an extended compose sequence to add a special character to a document.<\/p>","href":"acc_spec_characters_r.html","attributes":{"data-id":"acc_spec_characters_r"},"menu":{"hasChildren":false},"tocID":"acc_spec_characters_r-d4802e445","topics":[]}]}};